const invalidPassword = "12345678Aa";
// const passData = {
//   password: faker.internet.password(10, false, /[A-Za-z0-9]/, "James@"),
// };
user.enterpassword(invalidPassword);
cy.get("#password").invoke("val").then(password => {
  expect(password.length).to.be.gte(10);
  expect(/[a-z]/.test(password)).to.be.true;
  expect(/[A-Z]/.test(password)).to.be.true;
  expect(/\d/.test(password)).to.be.true;
  expect(/[!@#$%^&*(),.?":{}|<>]/.test(password)).to.be.true;
});

const invalidPhoneNumber = "234564588";
user.enterPhone(invalidPhoneNumber);
cy.get("#mobile_number").as("mobileNumber");
cy.get("@mobile_number").invoke("val").then(phone => {
  expect(phone.length).to.be.lte(12, "phone number should not exceed 12 digits");
  expect(/^\d+$/.test(phone)).to.be.true;
});
